// src/pages/AdminDashboard.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './AdminDashboard.css';
import { useNavigate } from 'react-router-dom';

const AdminDashboard = () => {
  const [mobiles, setMobiles] = useState([]);
  const [brand, setBrand] = useState('');
  const [model, setModel] = useState('');
  const [ram, setRam] = useState('');
  const [storage, setStorage] = useState('');
  const [price, setPrice] = useState('');
  const [condition, setCondition] = useState('');
  const [image, setImage] = useState(null);

  const navigate = useNavigate();

  const token = localStorage.getItem('token');

  useEffect(() => {
    if (!token) {
      navigate('/login');
      return;
    }

    const fetchMobiles = async () => {
      try {
        const response = await axios.get('/api/mobiles', {
          headers: { Authorization: `Bearer ${token}` }
        });
        setMobiles(response.data);
      } catch (err) {
        console.error('Error fetching mobiles:', err);
      }
    };

    fetchMobiles();
  }, [token, navigate]);

  const handleUpload = async (e) => {
    e.preventDefault();

    const formData = new FormData();
    formData.append('brand', brand);
    formData.append('model', model);
    formData.append('ram', ram);
    formData.append('storage', storage);
    formData.append('price', price);
    formData.append('condition', condition);
    formData.append('image', image);

    try {
      await axios.post('/api/mobiles/upload', formData, {
        headers: {
          'Content-Type': 'multipart/form-data',
          Authorization: `Bearer ${token}`
        }
      });

      alert('Mobile uploaded successfully!');
      window.location.reload();
    } catch (err) {
      console.error('Upload failed:', err);
      alert('Failed to upload mobile');
    }
  };

  const handleDelete = async (id) => {
    try {
      await axios.delete(`/api/mobiles/${id}`, {
        headers: { Authorization: `Bearer ${token}` }
      });
      setMobiles(mobiles.filter((m) => m._id !== id));
    } catch (err) {
      console.error('Delete failed:', err);
      alert('Failed to delete mobile');
    }
  };

  return (
    <div className="admin-dashboard">
      <h1>Admin Dashboard</h1>

      <form className="upload-form" onSubmit={handleUpload}>
        <h2>Upload Mobile</h2>
        <input type="text" placeholder="Brand" value={brand} onChange={(e) => setBrand(e.target.value)} required />
        <input type="text" placeholder="Model" value={model} onChange={(e) => setModel(e.target.value)} required />
        <input type="text" placeholder="RAM" value={ram} onChange={(e) => setRam(e.target.value)} required />
        <input type="text" placeholder="Storage" value={storage} onChange={(e) => setStorage(e.target.value)} required />
        <input type="number" placeholder="Price" value={price} onChange={(e) => setPrice(e.target.value)} required />
        <input type="text" placeholder="Condition" value={condition} onChange={(e) => setCondition(e.target.value)} required />
        <input type="file" onChange={(e) => setImage(e.target.files[0])} required />
        <button type="submit">Upload</button>
      </form>

      <div className="mobile-list">
        <h2>Uploaded Mobiles</h2>
        {mobiles.map((mobile) => (
          <div key={mobile._id} className="mobile-card">
            <img src={mobile.imageUrl} alt={mobile.model} />
            <div>
              <h3>{mobile.brand} - {mobile.model}</h3>
              <p>{mobile.ram} / {mobile.storage}</p>
              <p>{mobile.condition} - ₹{mobile.price}</p>
              <button onClick={() => handleDelete(mobile._id)}>Delete</button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default AdminDashboard;
